/* eslint-disable react/react-in-jsx-scope */
import './App.css';
import {
  BrowserRouter as Router, Route, Switch,
} from 'react-router-dom';

import Home from './views/Home';
import Committee from './views/Committee';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/committee">
          <Committee />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
